(26, '1', 'bin_10_w', 1, '', '', 11, '', '', '', '', '11.JPG', '<p>Penggunaan media sosial dapat mendukung proses pembelajaran siswa di dalam kelas, dapat digunakan sebagai sumber belajar untuk mencari referensi</p>', '<p>Media sosial sebagai sarana komunikasi untuk meningkatkan keterampilan dan kemampuan siswa tanpa khawatir perbedaan jarak dan waktu</p>', '<p>Media sosial dapat membangun kepercayaan diri para pelajar yang mungkin tidak mereka miliki di dunia nyata, mereka bebas menyampaikan argumentasi.</p>', '<p>Penggunaan media sosial memiliki banyak dampak positif jika digunakan secara tepat, seperti menumbuhkan rasa percaya diri seseorang.</p>', '<p>Penggunaan media sosial berdampak positif jika diimbangi dengan pengawasan dari orang tua dan guru secara bersinergi.</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(27, '1', 'bin_10_w', 1, '', '', 12, '', '<p>Bacalah teks di bawah ini!</p>\n<p>Media Sosial</p>\n<p>Moderator</p>\n<p>Assalamualaikum, wr. wb. Selamat pagi.</p>\n<p>Terima kasih atas kehadiran rekan-rekan pada siang ini. Siang ini, kita akan mengikuti kegiatan debat. Kita akan membahas pengaruh penggunaan media sosial di lingkungan sekolah. Media sosial saat ini tidak dapat terlepas dalam kehidupan kita. Pengguna media sosial bahkan dari kalangan muda hingga kalangan tua. Penggunaan media sosial tentunya berpengaruh terhadap kehidupan terutama kehidupan di lingkunfan sekolah.</p>\n<p>Tim afirmasi</p>\n<p>Seperti yang kita ketahui bersama, di era yang serba digital ini, jarak dan waktu bukanlah sebuah halangan. Media sosial telah menjembatani perbedaan tersebut. Melalui media sosial, siswa dapat membangun komunitas belajar dengan mudah. Hal ini tentunya dapat meningkatkan keterampilan dan kemampuan siswa tanpa khawatir akan perbedaan jarak dan waktu.</p>\n<p>Tim oposisi</p>\n<p>Saya kurang setuju dengan pendapat tim afirmasi. Pada kenyataannya, siswa akan dengan mudah teralih pada hal yang lain selain belajar. Contohnya saja menggunakan media sosial tersebut untuk berkomunikasi secara pribadi alih-alih belajar. Selain itu, media sosial akan melemahkan interaksi sosial para pelajar di dunia nyata. Mereka akan sibuk dengan gawai dan media sosial masing-masing, serta tidak memperhatikan lingkungan sekitar.</p>\n<p>Tim afirmasi</p>\n<p>Saya kurang setuju dengan pendapat tim oposisi yang menyatakan bahwa media sosial melemahkan interaksi sosial para pelajar di dunia nyata. Justru media sosial dapat membangun kepercayaan diri para pelajar yang mungkin tidak mereka miliki di dunia nyata. Melalui media sosial, para pelajar tersebut bebas berargumentasi dan terlibat dalam kegiatan pembelajaran yang berlangsung pada media sosial. Hal tersebut tentu akan menambah kepercayaan diri mereka.</p>\n<p>Tim oposisi</p>\n<p>Saya ingin menanggapi pernyataan dari tim afirmasi. Memang benar para pelajar yang cenderung kurang berani dalam mengemukakan pendapat akan dapat membangun kepercayaan diri di media sosial. Akan tetapi, hanya dalam lingkup media sosial. Sedangkan kita hidup di dunia nyata. Lalu, buat apa itu semua?. Terlebih lagi jika pelajar tersebut menjadi bergantung pada media sosial yang pada akhirnya akan berimbas pada kecanduan terhadap media sosial. Hal ini tentu akan mengganggu pola interaksi antarindividu di dunia nyata.</p>\n<p>Tim afirmasi</p>\n<p>Kecanduan terhadap media sosial dapat diatasi dengan menerapkan aturan yang tegas tentang waktu untuk mengakses media sosial. Bukan hanya media sosial yang berpotensi untuk membuat candu, banyak hal lain juga dapat membuat seseorang bisa kecanduan. Akan tetapi, hal tersebut dapat diminimalisasi. Singkatnya, tim kami percaya bahwa penggunaan media sosial memiliki banyak dampak positif jika digunakan secara tepat, seperti menumbuhkan rasa percaya diri seseorang, menambah pertemanan, dan membentuk suatu komunitas belajar. Hal ini dapat terwujud jika diimbangi dengan pengawasan dari orang tua dan guru secara bersinergi.</p>\n<p>Tim oposisi</p>\n<p>Memang kecanduan terhadap media sosial dapat diatasi dengan penerapan aturan yang tegas. Akan tetapi, apakah Anda yakin aturan tersebut benar-benar akan berjalan sesuai harapan?.Pada akhirnya, tim kami, yaitu tim oposisi tetap beranggapan bahwa penggunaan media sosial di lingkungan sekolah tidak membawa dampak yang baik karena para pelajar tersebut akan fokus pada dunia maya dan melupakan tujuan awal mereka menggunakan media sosial. Selain itu, media sosial juga dapat menimbulkan rasa candu. Para siswa akan merasa gelisah ketika tidak mengakses media sosial. Pada akhirnya, mereka akan sibuk dengan media sosial dan mulai lupa waktu, sehingga mereka melupakan tugas utama, yaitu belajar.</p>\n<p><strong>.Mosi yang tepat untuk teks debat di atas adalah&hellip;.</strong></p>', '', '', '', '<p>Pengaruh buruk media sosial di kalangan remaja</p>', '<p>Pengaruh media sosial di lingkungan sekolah</p>', '<p>Penggunaan media sosial bagi siswa di sekolah</p>', '<p>Peranan media sosial untuk pembelajaran di sekolah</p>', '<p>Dampak positif penggunaan media sosial&nbsp;</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
