(54, '1', 'bin_10_w', 1, '', '', 38, '', '<p>Bacalah puisi berikut dengan saksama!</p>\n<p>Di mana pembangunan ini</p>\n<p>Tuan hidup kembali</p>\n<p>Dan bara kagum menjadi api</p>\n<p>Di depan sekali tuan menanti</p>\n<p>Tak gentar lawan banyaknya seratus kali</p>\n<p>Pedang di kanan, keris di kiri</p>\n<p>Berselubung semangat yang tak bisa mati</p>\n<p>&hellip;&hellip;&hellip;</p>\n<p>(Diponegoro: Chairil anwar)</p>\n<p><strong>Makna yang terkandung dalam kutipan puisi tersebut adalah&hellip;.</strong></p>', '', '', '', '<p>Sekarang ini Indonesia harus membangun semangat juang para pahlawan.</p>', '<p>Jangan gentar menghadapi masalah pembangunan apa saja.</p>', '<p>Semangat juang para pahlawan harus diteladani dalam membangun negeri.</p>', '<p>Pedang dan keris adalah senjata yang ampuh digunakan untuk berjuang.</p>', '<p>Pahlawan itu tidak boleh menyerah dan tidak boleh merasa gentar</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
