(226, '1', 'SEJ.P_XIPS', 1, '', '', 10, '', '<p>Mencari dan mengumpulkan sumber-sumber sejarah yang terkait dengan topik penelitian disebut....</p>\n<p>&nbsp;</p>', '', '', '', '<p>Interpretasi</p>', '<p>Heuristik</p>', '<p>Kritik</p>', '<p>Verifikasi</p>', '<p>Historiografi</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(225, '1', 'SEJ.P_XIPS', 1, '', '', 9, '', '<p>Tujuan berpikir sinkronik dalam mempelajari sejarah adalah...</p>\n<p>&nbsp;</p>', '', '', '', '<p>Melihat perubahan dan perkembangan suatu peristiwa sejarah secara struktural</p>', '<p>Mempermudah mengkaji peristiwa sejarah karena telah sesuai urutan waktu</p>', '<p>Tidak terjadi tumpang tindih atau bertumpukan antarperistiwa sejarah</p>', '<p>Mempemudah penerapan konsep periodisasi dan kronolosi</p>', '<p>Mempelajari peristiwa sejarah sesuai waktu terjadinya</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(224, '1', 'SEJ.P_XIPS', 1, '', '', 8, '', '<p>Jika mempelajari peristiwa sejarah secara menyeluruh, meliputi waktu yang panjang, tetapi terbatas dalam ruang, Anda menggunakan konsep berpikir...</p>', '', '', '', '<p>Kronik</p>', '<p>Sinkronik</p>', '<p>Diakronik</p>', '<p>Kronologi</p>', '<p>Anakronisme&nbsp;</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(223, '1', 'SEJ.P_XIPS', 1, '', '', 7, '', '<p>Konsep kronologi sangat diperlukan dalam mempelajari ilmu sejarah. Konsep ini bertujuan untuk....</p>\n<p>&nbsp;</p>', '', '', '', '<p>Menyeleksi berbagai peristiwa</p>', '<p>Mengklasifikasi berbagai peristiwa</p>', '<p>Mengurutkan peristiwa berdasarkan waktu</p>', '<p>Mengungkapkan berbagai peristiwa</p>', '<p>Membuat pedoman peristiwa penting</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(222, '1', 'SEJ.P_XIPS', 1, '', '', 6, '', '<p>Perhatikan informasi berikut :</p>\n<p>1)Penafsiran ilmu sejarah bersifat objektif dalam arti dapat dibuktikan kebenarannya</p>\n<p>2)Sejarah menceritakan peristiwa yang benar-benar terjadi</p>\n<p>3)Sejarah menceritakan peristiwa-peristiwa masa lampau</p>\n<p>4)Sejarah bertujuan memberi legitimasi kekuasaan kepada para pejabat</p>\n<p>5)Semua peristiwa sejarah dapat menjadi panutan serta pedoman bagi pembacanya</p>\n<p><strong>Berdasarkan informasi diatas tadi, ciri-ciri sejarah sebagai ilmu adalah&hellip;</strong></p>', '', '', '', '<p>1), 2), dan 3).</p>', '<p>1), 2), dan 4).</p>', '<p>2), 3), dan 4)</p>', '<p>3), 4), dan 5).</p>', '<p>2), 4), dan 5)</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(221, '1', 'SEJ.P_XIPS', 1, '', '', 5, '', '<p>Empat tahun lalu anda masih duduk di bangku SD, tahun lalu anda masih duduk di bangku SMP, dan saat ini anda duduk di bangku SMA. Berdasarkan kenyataan tersebut, dapat ditarik</p>\n<p>kesimpulan bahwa &hellip;</p>', '', '', '', '<p>Kehidupan manusia mengalami perkembangan dari masa ke masa</p>', '<p>Pemerintah menerapkan Pendidikan berjenjang hingga tingkat SMA</p>', '<p>Proses peralihan Pendidikan dari jenjang SD menuju SMP dan SMA wajib dilalui setiap anak</p>', '<p>SMP merupakan jenjang yang tepat bagi seorang anak yang menyelesaikan Pendidikan di tingkat SD</p>', '<p>Kesuksesan seseorang pada masa depan ditentukan oleh kualitas Pendidikan saat SD hingga SMA</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(220, '1', 'SEJ.P_XIPS', 1, '', '', 4, '', '<p>Sebuah kota selalu berkembang dari masa ke masa. Perkembangan tersebut dapat dilihat dari bertambahnya Gedung, jembatan, dan tempat ibadah. Dalam bidang kemasyarakatan</p>\n<p>perkembangan ini biasanya berdampak pada&hellip;.</p>', '', '', '', '<p>Muncul pemukiman kumuh di pinggiran kota</p>', '<p>Pola kehidupan masyarakat menjadi lebih dinamis dan modern</p>', '<p>Nilai penghargaan terhadap benda-benda warisan masa lalu semakin luntur</p>', '<p>Muncul Gerakan reformasi untuk menentang kelompok masyarakat mapan</p>', '<p>Ruang interaksi antara komunitas satu dengan komunitas lain semakin terbuka&nbsp;</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(219, '1', 'SEJ.P_XIPS', 1, '', '', 3, '', '<p>Peristiwa sejarah merupakan suatu proses perubahan dan berkesinambungan yang terjadi dalam kehidupan manusia di masa lampau. Perubahan dan kesinambungan tersebut selaras dengan perjalanan waktu. Hal ini menunjukkan bahwa peristiwa sejarah itu ....</p>', '', '', '', '<p>Hubungan antara pelaku dan penulis sejarah</p>', '<p>Tidak memiliki hubungan dengan masa kini</p>\n<p>&nbsp;</p>', '<p>Terdapat keterkaitan dengan peristiwa lainnya</p>', '<p>Tergantung siapa yang menjadi penulisnya</p>', '<p>Tergantung siapa yang menjadi pelakunya</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(218, '1', 'SEJ.P_XIPS', 1, '', '', 2, '', '<p>Pembacaan teks proklamasi yang dilakukan oleh Soekarno menjadi titik puncak kemerdekaan Indonesia. Dalam konsep sejarah, Soekarno dalam hal ini menjelaskan manusia sebagai...</p>', '', '', '', '<p>Ruang</p>', '<p>Manusia</p>', '<p>Waktu</p>', '<p>Objek</p>', '<p>Subjek&nbsp;</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(217, '1', 'SEJ.P_XIPS', 1, '', '', 1, '', '<p>Proklamasi kemerdekaan indonesia dibacakan pada 17 Agustus 1945, itulah mengapa tanggal tersebut diperingati sebagai hari kemerdekaan Indonesia. Hal ini berkenaan dengan konsep sejarah sebagai&hellip;.</p>\n<p>&nbsp;</p>', '', '', '', '<p>Ruang</p>', '<p>Manusia</p>', '<p>Waktu</p>', '<p>Objek</p>', '<p>Subjek</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
