(230, '1', 'SEJ.P_XIPS', 1, '', '', 14, '', '<p>Umumnya fosil-fosil makhluk purba yang ditemukan para arkeolog terdapat didaerah aliran sungai. Hal ini dapat disimpulkan bahwa &hellip;.</p>', '', '', '', '<p>Pemakaman makhluk purba terletak di tepi sungai</p>\n<p>&nbsp;</p>', '<p>Adanya kehidupan masyarakat terapung di masa lalu</p>', '<p>Makhluk purba tinggal, beraktifitas, dan melakukan interaksi sosial di sekitar aliran sungai</p>', '<p>Banyak makhluk purba yang meninggal di daerah aliran sungai</p>', '<p>Daerah tempat tinggal makhluk purba di masa lalu berubah menjadi sungai dimasa kini</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(231, '1', 'SEJ.P_XIPS', 1, '', '', 15, '', '<p>Sumbangan Indonesia dalam perkembangan ilmu pengetahuan di dunia terutama kajian arkeologi sangat penting. Hal ini terbukti dari adanya penemuan jenis manusia tertua di Pulau Jawa yaitu....</p>', '', '', '', '<p>Homo soloensis</p>', '<p>Sinanthropus pekenisis</p>', '<p>Pithecanthropus erectus</p>', '<p>Neathertal</p>', '<p>Meganthropus paleojavanicus</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
