(233, '1', 'SEJ.P_XIPS', 1, '', '', 17, '', '<p>Jenis manusia purba afrika yang mendapat julukan kera dari afrika selatan adalah...</p>', '', '', '', '<p>Australopithecus africanus</p>', '<p>Australopithecus afarensis</p>', '<p>Ardipithecus ramidus</p>\n<p>&nbsp;</p>', '<p>Homo rhodesiensis</p>', '<p>Cro-Magnon</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(234, '1', 'SEJ.P_XIPS', 1, '', '', 18, '', '<p>Manusia purba afrika yang memiliki ciri volume otak 435-530 cm3, dan gigi geraham depan memiliki dua puncak, tangan yang panjang dan gulang jari yang melengkung adalah...</p>', '', '', '', '<p>Homo rodhesiensis</p>', '<p>Asutralopithecus afarensis</p>\n<p>&nbsp;</p>', '<p>Australopithecus africanus</p>', '<p>Australophitecus ramidus</p>', '<p>Homo sapiens</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(235, '1', 'SEJ.P_XIPS', 1, '', '', 19, '', '<p>Banyak manusia purba dari luar Indonesia yang hidup se-zaman dengan manusia purba di Indonesia. Manusia purba dari gua Chou Kou Tien, Tiongkok yang memiliki banyak kesamaan dengan Phitecanthropus erectus di Indonesia adalah...</p>', '', '', '', '<p>Australopothecus</p>', '<p>Giganthropus</p>', '<p>Homo sapiens</p>\n<p>&nbsp;</p>', '<p>Sinanthropus pekinensis</p>', '<p>Homo wajakensis</p>', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
