(237, '1', 'SEJ.P_XIPS', 1, '', '', 21, '', '<p>Keberadaan gambar tangan pada dinding-dinding gua pada masa berburu dan mengumpulkan manakanan tingkat lanjut menunjukkan bahwa manusia pra aksara telah mengenal sistem kepercayaan berupa....</p>', '', '', '', '<p>Keyakinan terhadap alam selanjutnya setelah kematian</p>', '<p>Kemampuan berkomunikasi dengan alam</p>', '<p>Tanda kehormatan dan belasungkawa tehadap kematian</p>', '<p>Sebagai bentuk penghormatan tehadap kekuatan tertentu</p>', '<p>Konsepsi kesuburan yang menajdi harapan&nbsp;</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(238, '1', 'SEJ.P_XIPS', 1, '', '', 22, '', '<p>Tumpukan sampah dapur berupa kulit kerang/siput yang menggunung pada masa berburu dan mengumpulkan makanan adalah..</p>\n<p>&nbsp;</p>', '', '', '', '<p>Kjokkenmoddinger</p>', '<p>Nomaden</p>', '<p>Bivalve</p>', '<p>a cire perdue</p>', '<p>Sedenter</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(239, '1', 'SEJ.P_XIPS', 1, '', '', 23, '', '<p>Kebudayaan Bac son-Hoa binh dan Dongson berkembang di daerah Vietnam, namun asalnya dari Cina. Kebudayaan Dongson berkembang pada akhir zaman ...</p>\n<p>&nbsp;</p>', '', '', '', '<p>Mesolithikum</p>', '<p>Logam</p>', '<p>Megalithikum</p>', '<p>Palaeolithikum</p>', '<p>Neolithikum</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(240, '1', 'SEJ.P_XIPS', 1, '', '', 24, '', '<p>Pada zaman batu muda, manusia sudah mengenal cara bercocok tanam. Cara hidup manusia purba tersebut disebut ....</p>', '', '', '', '<p>Nomaden</p>\n<p>&nbsp;</p>', '<p>Food producing</p>', '<p>Food gathering</p>', '<p>Sedenter</p>', '<p>Semi-sedenter</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(241, '1', 'SEJ.P_XIPS', 1, '', '', 25, '', '<p>Salah satu periodisasi masa praaksara adalah masa perundagian. Salah satu karakteristik manusia pada masa perundagian dan sampai saat ini masih juga masih dapat kita jumpai adalah....</p>\n<p>&nbsp;</p>', '', '', '', '<p>Cakap bersosialisasi dengan orang yang seprofesi</p>', '<p>Mampu mengembangkan kemampuan berburu</p>', '<p>Mampu beradaptasi dengan lingkungan baru</p>', '<p>Mampu bekerja sesuai dengan stratifikasi sosial</p>', '<p>Terampil membuat peralatan dari logam</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
