(667, '1', 'BinX_Wajib_IPA', 1, '', '', 12, '', '', '', '', '12BIN.JPG', '<p>Pengaruh buruk media sosial di kalangan remaja</p>', '<p>Pengaruh media sosial di lingkungan sekolah</p>', '<p>Penggunaan media sosial bagi siswa di sekolah</p>', '<p>Peranan media sosial untuk pembelajaran di sekolah</p>', '<p>Dampak positif penggunaan media sosial&nbsp;</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
