(656, '1', 'BinX_Wajib_IPA', 1, '', '', 24, '', '', '', '', '24.JPG', '<p>Menggunakan alur maju, cerita diawali dengan pengenalan latar belakang jerome hingga kisah sukses yang didapatkannya</p>', '<p>Menggunakan sudut pandang orang ketiga serba tahu karena penyampaiannya disajikan secara rinci</p>', '<p>Menggunakan gaya penulisan naratif karena menceritakan urutan peristiwa secara kronologis</p>', '<p>Fokus penceritaan dalam biografi tersebut berfokus pada keberhasilan karier yang dicapai Jerome Polin</p>', '<p>Penulis tidak menggunakan percakapan atau dialog tokoh sehingga gaya penulisannya naratif</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(653, '1', 'BinX_Wajib_IPA', 1, '', '', 21, '', '', '', '', '21.JPG', '<p>Jermome Polin merupakan anak kedua dari tiga bersaudara dari pasangan dari bapak Marojahan Sijabat dan Chrissie Rahmeinsa</p>', '<p>Jerome kuliah di Universitas Waseda dengan jurusan matematika terapan dan aktif membuat konten edukatif di channel Youtube Nihongo Mantappu</p>', '<p>Jerome Polin mendapatkan beasiswa 100% dari Mitsui Bussan Scholarship dan berangkat ke Jepang pada pertengahan tahun 2016</p>', '<p>Selama satu tahun setengah, Jerome Polin bersekolah bahasa Jepang sebelum memulai pendidikannya di Universitas Waseda</p>', '<p>Selain di Universitas Waseda, Jerome Polin juga diterima kuliah di National University of Singapore dan Nanyang Technological University</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(654, '1', 'BinX_Wajib_IPA', 1, '', '', 22, '', '', '', '', '22.JPG', '<p>Jerome Polin dan keluarganya pindah ke Surabaya dan mendaftar sekolah internasional</p>', '<p>Orang tua Jerome Polin sempat mengalami kesulitan ekonomi untuk menyekolahkannya</p>', '<p>Jerome Polin diterima di dua universitas sekaligus di Singapura dan di Universitas Waseda Jepang</p>', '<p>Jerome Polin berusaha untuk mendapatkan beasiswa dengan mengumpulkan persyaratannya.</p>', '<p>Jerome bersedih karena tidak dapat berlibur ke luar negeri seperti teman-temannya di sekolah</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(652, '1', 'BinX_Wajib_IPA', 1, '', '', 27, '', '<p>Bacalah kutipan biografi di bawah ini!</p>\n<p>Parama Pradana Suteja, putra Solo kelahiran 25 tahun silam ini mendadak menjadi sorotan media. Tak sekadar kuliah di luar negeri, Parama juga sukses membuat takjub akan prestasinya yang luar biasa. Dirinya diterima oleh 11 universitas ternama di AS untuk program pascasarjananya, salah satunya Harvard University.</p>\n<p>Dalam wawancara eksklusifnya dengan Soloraya.id, Parama yang sebelumnya menyelesaikan studi S1-nya di UC (University of California) Berkeley, jurusan arsitektur ini menjelaskan bahwa dirinya tidak pernah membayangkan bisa mengambil studi di AS karena latar belakang pendidikannya berasal dari sekolah berbasis kurikulum nasional. Namun keputusannnya mendadak berubah saat dirinya bertemu dengan mantan kakak kelasnya saat duduk di bangku SMA di Solo yang bersekolah di AS dan bekerja di Apple Inc. Pertemuan itu membuat dirinya akhirnya memilih untuk studi di AS dan saat studi S1-nya, Parama mencoba peruntungan untuk melanjutkan studi program pasca sarjana dan mengejutkannya, Parama diterima di 11 universitas ternama di AS dengan 7 penawaran beasiswa.</p>\n<p><strong>Keistimewaan tokoh Parama Pradana Suteja adalah&hellip;..</strong></p>', '', '', '', '<p>Menjadi sorotan media karena prestasi di bidang pendidikan yang dicapainya</p>', '<p>Diterima di 11 Universitas ternama di AS untuk program Pascasarjana</p>', '<p>Menyelesaikan studi S1-nya di UC (University of California) Berkeley</p>', '<p>Bersekolah di AS dan bekerja di perusahaan terkenal yaitu Apple Inc</p>\n<p>&nbsp;</p>', '<p>Melanjutkan studi sarjana dan pascasarjana di negara Amerika Serikat</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(650, '1', 'BinX_Wajib_IPA', 1, '', '', 28, '', '', '', '', '28.JPG', '<p>Menggunakan kata kerja mental seperti termasuk, memulai,</p>', '<p>Menggunakan pronomina seperti kata ganti beliau dan ia</p>', '<p>Menggunakan kata tindakan seperti merupakan dan wartawan</p>', '<p>Menggunakan kata kerja pasif seperti di sana dan di berbagai</p>\n<p>&nbsp;</p>', '<p>Menggunakan kata adjektiva seperti ningrat&nbsp; dan nafas</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(651, '1', 'BinX_Wajib_IPA', 1, '', '', 29, '', '', '', '', '29.JPG', '<p>Ayunda Faza Maudya, B.A., M.A., M.B.A. lahir di Jakarta, 19 Desember 1994 dari orang tua bernama Didit Jasmedi R. Irawan dan Muren Murdjoko. Maudy Ayunda dikenal sebagai Aktris dan penyanyi berbakat. Berbagai prestasi telah diraihnya. Pada tahun 2006 Dia juga mendapatkan penghargaan Aktris Utama Terpilih oleh Festival Film Jakarta&nbsp; tahun, Di tahun 2015, Dia dinobatkan menjadi pembicara muda di Forum Ekonomi Global. Selanjutnya, pada tahun 2016, dia dipilih menjadi Wanita Inspiratif Indonesia oleh Kementerian Pemberdayaan Perempuan dan Perlindungan Anak Republik Indonesia Tahun. Dia juga memenangkan BUBU Awards sebagai &ldquo;Influencer Digital Terbaik&rdquo; dan &ldquo;Milenial paling Berpengaruh&rdquo; oleh Style Awards. Selain itu, dia juga Terpilih dalam Forbes Indonesia &ldquo;30 Under &ldquo; di kategori Art, Syle, and Entertainment pada tahun 2020. Prestasinya sangat banyak sekali. Patut dijadikan contoh.</p>\n<p>&nbsp;</p>', '<p>Maudy Ayunda lahir di Jakarta, 19 Desember 1994 dari orang tua bernama Didit Jasmedi R. Irawan dan Muren Murdjoko. Berbagai prestasi telah diraihnya. Prestasinya sangat banyak dan mengisnpirasi. Pada tahun 2006 Dia juga mendapatkan penghargaan Aktris Utama Terpilih oleh Festival Film Jakarta&nbsp; tahun, Di tahun 2015, Dia dinobatkan menjadi pembicara muda di Forum Ekonomi Global. Selanjutnya, pada tahun 2016, dia dipilih menjadi Wanita Inspiratif Indonesia oleh Kementerian Pemberdayaan Perempuan dan Perlindungan Anak Republik Indonesia Tahun. Dia juga memenangkan BUBU Awards sebagai &ldquo;Influencer Digital Terbaik&rdquo; dan &ldquo;Milenial paling Berpengaruh&rdquo; oleh Style Awards. Selain itu, dia juga Terpilih dalam Forbes Indonesia &ldquo;30 Under &ldquo; di kategori Art, Syle, and Entertainment pada tahun 2020.</p>', '<p>&nbsp;</p>\n<p>Ayunda Faza Maudya, B.A., M.A., M.B.A. atau yang dikenal dengan nama Maudy Ayunda lahir di Jakarta, 19 Desember 19