(648, '1', 'BinX_Wajib_IPA', 1, '', '', 32, '', '<p class=\"MsoListParagraph\" style=\"margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 32.2pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1; background: white;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-language: EN-ID;\" lang=\"EN-ID\">&ldquo;<em>Pita hitam pada karangan bunga&rdquo; </em>pada larik tersebut frasa <em>pita hitam </em>menyimbolkan&hellip;.</span></p>', '', '', '', '<p>Kesedihan</p>', '<p>&nbsp;</p>\n<p>Kedukaan</p>', '<p>&nbsp;</p>\n<p>kegembiraan</p>', '<p>&nbsp;</p>\n<p>Kesucian</p>', '<p>&nbsp;</p>\n<p>Kegelapan</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
