(645, '1', 'BinX_Wajib_IPA', 1, '', '', 34, '', '', '', '', '34.JPG', '<p>Ada sesuatu yang rasanya mulai lepas dari tangandan meluncur lewat sela-sela jari kitaBanjir air mata</p>', '<p>Kita saksikan udara abu-abu warnanyaKita saksikan air danau yang semakin surut jadinyaGunung membawa abu</p>', '<p>Kita saksikan zat asam didesak asam arangdan karbon dioksida itu menggilas paru-paruBanjir air mata</p>', '<p>Kita saksikan zat asam didesak asam arangdan karbon dioksida itu menggilas paru-paru Longsor membawa air</p>\n<p>&nbsp;</p>', '<p>Kita saksikan udara abu-abu warnanyaKita saksikan air danau yang semakin surut jadinyaBanjir air mata</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(644, '1', 'BinX_Wajib_IPA', 1, '', '', 33, '', '', '', '', '32.JPG', '<p>Ada sesuatu yang rasanya mulai lepas dari tangan</p>', '<p>Kita saksikan air danau yang semakin surut jadinya</p>', '<p>&nbsp;</p>\n<p>Kita saksikan udara abu-abu warnanya</p>', '<p>&nbsp;</p>\n<p>Burung-burung kecil tak lagi berkicau di pagi hari</p>', '<p>&nbsp;</p>\n<p>Kita telah saksikan seribu tanda-tanda</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(643, '1', 'BinX_Wajib_IPA', 1, '', '', 38, '', '<p>Bacalah puisi berikut dengan saksama!</p>\n<p>Di mana pembangunan ini</p>\n<p>Tuan hidup kembali</p>\n<p>Dan bara kagum menjadi api</p>\n<p>Di depan sekali tuan menanti</p>\n<p>Tak gentar lawan banyaknya seratus kali</p>\n<p>Pedang di kanan, keris di kiri</p>\n<p>Berselubung semangat yang tak bisa mati</p>\n<p>&hellip;&hellip;&hellip;</p>\n<p>(Diponegoro: Chairil anwar)</p>\n<p><strong>Makna yang terkandung dalam kutipan puisi tersebut adalah&hellip;.</strong></p>', '', '', '', '<p>Sekarang ini Indonesia harus membangun semangat juang para pahlawan.</p>', '<p>Jangan gentar menghadapi masalah pembangunan apa saja.</p>', '<p>Semangat juang para pahlawan harus diteladani dalam membangun negeri.</p>', '<p>Pedang dan keris adalah senjata yang ampuh digunakan untuk berjuang.</p>', '<p>Pahlawan itu tidak boleh menyerah dan tidak boleh merasa gentar</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(642, '1', 'BinX_Wajib_IPA', 1, '', '', 35, '', '', '', '', '35.JPG', '<p>Manusia harus dapat menjaga kelestarian alam sehingga tidak menimbulkan bencana alam</p>', '<p>Manusia tidak boleh hanya menyaksikan bencana alam saja tetapi harus dijadikan pelajaran</p>', '<p>Manusia harus peka terhadap perubahan alam yang semakin lama semakin memprihatinkan</p>', '<p>Manusia harus bertaubat karena telah merusak alam dengan perbuatannya yang tidak terpuji</p>', '<p>Manusia harus memohon ampun karena telah merusak alam dengan perbuatannya yang tidak baik</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(641, '1', 'BinX_Wajib_IPA', 1, '', '', 37, '', '<p>Bacalah dengan cermat puisi di bawah ini!</p>\n<p>Aku lalai di hari pagi</p>\n<p>Beta lengah di masa muda</p>\n<p>Kini hidup meracun hati</p>\n<p>Miskin ilmu miskin harta</p>\n<p>(Menyesal, A. Hasyim)</p>\n<p><strong>Kata meracun hati pada puisi di atas melambangkan&hellip;.</strong></p>', '', '', '', '<p>kekesalan</p>', '<p>kekhwatiran</p>', '<p>kelalaian</p>', '<p>keteledoran</p>', '<p>kesususahan</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(640, '1', 'BinX_Wajib_IPA', 1, '', '', 39, '', '', '', '', '39.JPG', '<p>berlarian, nyanyian, berguncang</p>', '<p>bernyanyian, cacian, mengguncang</p>', '<p>kelaparan, cacian, berguncang</p>', '<p>berlarian, nyanyian, mengguncang</p>', '<p>kelaparan, azan, mengguncang</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(620, '1', 'BinX_Wajib_IPS', 1, '', '', 21, '', '', '', '', '21.JPG', '<p>Jermome Polin merupakan anak kedua dari tiga bersaudara dari pasangan dari bapak Marojahan Sijabat dan Chrissie Rahmeinsa</p>', '<p>Jerome kuliah di Universitas Waseda dengan jurusan matematika terapan dan aktif membuat konten edukatif di channel Youtube Nihongo Mantappu</p>', '<p>Jerome Polin mendapatkan beasiswa 100% dari Mitsui Bussan Scholarship dan berangkat ke Jepang pada pertengahan tahun 2016</p>', '<p>Selama satu tahun setengah, Jerome Polin bersekolah bahasa Jepang sebelum memulai pendidikannya di Universitas Waseda</p>', '<p>Selain di Universitas Waseda, Jerome Polin juga diterima kuliah di National University of Singapore dan Nanyang Technological University</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(621, '1', 'BinX_Wajib_IPS', 1, '', '', 22, '', '', '', '', '22.JPG', '<p>Jerome Polin dan keluarganya pindah ke Surabaya dan mendaftar sekolah internasional</p>', '<p>Orang tua Jerome Polin sempat mengalami kesulitan ekonomi untuk menyekolahkannya</p>', '<p>Jerome Polin diterima di dua universitas sekaligus di Singapura dan di Universitas Waseda Jepang</p>', '<p>Jerome Polin berusaha untuk mendapatkan beasiswa dengan mengumpulkan persyaratannya.</p>', '<p>Jerome bersedih karena tidak dapat berlibur ke luar negeri seperti teman-temannya di sekolah</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(622, '1', 'BinX_Wajib_IPS', 1, '', '', 23, '', '', '', '', '23.JPG', '', '', '', '', '', '23A.JPG', '23B.JPG', '23C.JPG', '23D.JPG', '23E.JPG', '1', 1, 'A', 'Y', '', ''),
(623, '1', 'BinX_Wajib_IPS', 1, '', '', 24, '', '', '', '', '24.JPG', '<p>Menggunakan alur maju, cerita diawali dengan pengenalan latar belakang jerome hingga kisah sukses yang didapatkannya</p>', '<p>Menggunakan sudut pandang orang ketiga serba tahu karena penyampaiannya disajikan secara rinci</p>', '<p>Menggunakan gaya penulisan naratif karena menceritakan urutan peristiwa secara kronologis</p>', '<p>Fokus penceritaan dalam biografi tersebut berfokus pada keberhasilan karier yang dicapai Jerome Polin</p>', '<p>Penulis tidak menggunakan percakapan atau dialog tokoh sehingga gaya penulisannya naratif</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(624, '1', 'BinX_Wajib_IPS', 1, '', '', 25, '', '', '', '', '25.JPG', '<p>Struktur orientasi terdapat pada paragraf 1 yang berisi pengenalan latar belakang Jerome Polin</p>', '<p>Paragraf 2 juga termasuk kalimat 1 dan 2 termasuk struktur orientasi karena berisi pengenalan Jerome Poliin</p>', '<p>Struktur peristiwa dan masalah terdapat pada paragraf 2 yang berisi riwayat sekolah dan masalah yang dihadapi</p>', '<p>Paragraf 3 juga termasuk struktur peristiwa dan masalah yang dihadapi Jerome Polin untuk mendapatkan beasiswa</p>', '<p>Paragraf 4 termasuk bagian reorientasi karena berisi sudut pandang penulis terhadap Jerome Polin</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(625, '1', 'BinX_Wajib_IPS', 1, '', '', 26, '', '<p>Bacalah kutipan teks biografi di bawah ini!</p>\n<p>Dokter Mohammad Hatta yang lebih dikenal dengan sebutan Bapak Koperasi Indonesia adalah seorang pemimpin yang berdisiplin tinggi, tegas, dan taat beragama. Pembawaannya sederhana walaupun ia keturunan berada dan apa yang dikatakannya selalu sesuai dengan perbuatannya. Bung Hatta lahir tanggal 12 Agustus 1902 di Bukittinggi. Pendidikan yang pernah ditempuhnya adalah ELS, MULO, Prins Hendrik School (Sekolah Dagang Belanda), dan Handels Hongerschool (Sekolah Tinggi Perdagangan) di Negeri Belanda hingga tamat. Pada tahun 1932, Bung Hatta memimpin partai Pendidikan Nasional Indonesia, karena kegiatan poliknya, Bung Hatta ditangkap dan pada tahun 1935 beliau di buang di Banda Neira dan terakhir di Sukabumi. Pada masa pendudukan Jepang tahun 1943 Bung Hatta memimpin kantor Pusat Tenaga Rakyat (Putera) bersama Bung Karno, Ki Hajar Dewantara, dan K.H. Mas Mansyur.</p>\n<p><strong>Keteladanan tokoh, Bapak Moh Hatta tersebut adalah . . . .</strong></p>', '', '', '', '<p>Berdisiplin tinggi, tegas, taat beragama, dan pembawaannya sederhana</p>', '<p>Bapak Koperasi Indonesia yang kehidupannya sangat sederhana</p>', '<p>Karena kegiatan politiknya, beliau rela dibuang ke Banda Neira</p>', '<p>Pendidikannya ditempuh di Negeri Belanda sejak SD hingga sekolah tinggi</p>', '<p>Memimpin kantor Pusat Tenaga Rakyat (Putera) bersama para pejuang bangsa</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(616, '1', 'BinX_Wajib_IPS', 1, '', '', 17, '', '<p>Paragraf di bawah ini yang menggunakan pengembangan analogi adalah&hellip;&hellip;</p>', '', '', '', '<p>Nasi goreng adalah makanan yang pada umumnya disukai oleh semua orang di seluruh dunia. Meskipun terlihat mudah dalam membuat, namun tidak terlihat. ternyata dalam membuat masakan yang satu ini tahapannya cukup rumit.&nbsp;</p>', '<p>Hujan yang terjadi pad amalam hari itu sangatlah deras, bahkan hujan tersebut terjadi sepanjang hari tanpa henti.air yang terus mengalir tersebut memenuhi selokan hingga selokan tidak mampu menampung air lagi. Terlebih lagi dengan keadaan sungai yang telah sempit dan dengkal membuat air meluap hingga ke perkampungan penduduk.oleh karena itu ,banjir datang dan menggenangi seluruh perkempungan penduduk.</p>', '<p>&nbsp;</p>\n<p>Tanpa kita sadar ada dua jenis teman yang ada disekitar kita. Kelompok yang pertama adalah teman dikalah senang. Teman-teman dikalah senang ini merupakan teman yang paling mudah dicari.mereka sangat banyak jumlahnya di luar sana .kelompok teman yang selanjutnya adalah teman dekat, teman dekat atau lebih dikenal dengan sahabat adalah teman yang benar-benar dekat dengan kita.</p>', '<p>&nbsp;</p>\n<p>Sifat manusia diibaratkan seperti padi yang terhapar luas dipersawahan. Padi yang bagus dan berisi akan semakin merunduk. Begitu pula dengan manusia ketika meraih kepandaian, kebesaran dan kekayaan, mereka akan menjadi semakin rendah hati dan dermawan. Apabila manusia itu sombong dan arogan mereka akan menjadi seperti padi kosong yang selalu berdiri tegak.</p>', '<p>&nbsp;</p>\n<p>Berdasarkan data keuangan tahun 2009, laba yang didapatkan oleh perusahaan PT X adalah sebesar 250 juta rupiah. Dimana pada tahun sebelumnya yaitu pada tahun 2008 perusahaan mampu menghasilkan laba sebesar 500 juta rupiah.Hal ini menunjukkan bahwa perusahaan mengalami penurunan dalam menghasilkan laba sebesar 250 juta rupiah atau turun sebesar 50% dari tahun sebelumnya.&nbsp;</p>', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(617, '1', 'BinX_Wajib_IPS', 1, '', '', 18, '', '<p>Penyebab polusi suara seperti kereta api, mobil, pesawat, motor, dan helikopter yang memiliki suara yang keras dan berbahaya bagi kehidupan manusia. Polusi suara berbahaya bagi kehidupan manusia karena bisa menyebabkan gangguan pendengaran, kognitif, mental, dan kesehatan lainnya.</p>\n<p><strong>Paragraf di atas menggunakan pola pengembangan paragraf &hellip;.</strong></p>', '', '', '', '<p>Analogi</p>', '<p>Deduktif</p>', '<p>&nbsp;</p>\n<p>Sebab akibat</p>', '<p>&nbsp;</p>\n<p>Generalisasi</p>', '<p>&nbsp;</p>\n<p>Perbandingan</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(618, '1', 'BinX_Wajib_IPS', 1, '', '', 19, '', '<p>Bacalah paragraf di bawah ini!</p>\n<p>(1)Saya fikir ponsellah yang membahayakan penggunanya. (2) Kita bisa melihat saat ini, ponsel tidak hanya digunakan oleh golongan orang dewasa tapi hampir semua umur menggunakan ponsel. (3) Bahkan anak-anak yang masih bersekolah TK sudah menggunakan ponsel. (4) Selain itu, melihat kecelakaan banyak terjadi di jalan raya yang disebabkan oleh ponsel.</p>\n<p><strong>Komentar yang TIDAK sesuai tentang penggunaan bahasa yang tepat dalam paragraf di atas adalah&hellip;</strong></p>', '', '', '', '<p>Paragraf tersebut menggunakan bahasa yang tidak baku dan kalimat yang tidak efektif</p>', '<p>Kata fikir&nbsp; seharusnya diganti piker, kata ponsel lebih tepat diganti dengan kata gawai</p>', '<p>Kalimat nomor 2 tidak efektif, menggunakan bahasa tidak baku, dan terlalu bertele-tele</p>', '<p>Kalimat nomor 3 tidak efektif, seharusnya anak-anak TK sudah menggunakan ponsel</p>', '<p>Kalimat nomor 4 merupakan kalimat yang memiliki penggunaan bahasa yang tepat</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(619, '1', 'BinX_Wajib_IPS', 1, '', '', 20, '', '<p>Bacalah paragraf di bawah ini!</p>\n<p>(1)Predikat kota Yogyakarta bukan hanya sekadar kota pelajar dan pariwisata, melainkan gudangnya industeri kecil, terutama kerajinan. (2) Ribuan industri kecil kerajinan berkembang di daerah ini, mulai dari skala kecil, misalnya suvenir hasil industri rumah tangga hingga skala besar yang bertaraf internasional. (3) Model-model yang dihasilkan juga sesuai dengan trend dunia.</p>\n<p><strong>Komentar yang sesuai dengan penggunaan bahasa dalam paragraf di atas adalah&hellip;.</strong></p>', '', '', '', '<p>Paragraf tersebut menggunakan bahasa baku</p>', '<p>&nbsp;</p>\n<p>Ada dua kata yang tidak menggunakan bahasa baku</p>', '<p>&nbsp;</p>\n<p>Kata predikat dan skala diganti dengan kata peredikat, sekala</p>', '<p>&nbsp;</p>\n<p>Kata industeri dan kata suvenir diganti dengan industri, souvenir</p>', '<p>&nbsp;</p>\n<p>Penulisan kata trend sudah tepat karena menggunakan bahasa baku</p>', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(615, '1', 'BinX_Wajib_IPS', 1, '', '', 16, '', '<p>Paragraf yang berisi sanggahan terhadap oposisi adalah &hellip;.</p>\n<p>&nbsp;</p>', '', '', '', '<p>Kehadiran situs jejaring sosial dalam beberapa tahun ini menjadi terapi bagi generasi muda. Mereka yang tidak berani tampil di luar, dapat&nbsp; mengekspresikan diri melalui media sosial. Mereka dapat berkenalan dengan seseorang , melalui layanan chatting.&nbsp;</p>', '<p>Kini gadget dapat menggantikan koran dan majalah. Melalui gadget, kita dapat melihat perkembangan berita terbaru. Kita dapat mengetahui berbagai informasi yang dibutuhkan melaui internet dalam gadget kita.&nbsp;</p>', '<p>Gadget berdampak buruk bagi perkembangan diri anak. Anak-anak tidak akan bisa bersosisalisasi dengan orang lain di sekitarnya, termasuk orang tua. Mereka sibuk dengan diri sendiri. Perintah dan nasihat orang tua tidak lagi mereka dengarkan.&nbsp;</p>', '<p>Sebagai alat komunikasi, gadget menjadi andalan siswa berinteraksi dengan teman-temannya. Alat ini mempermudah siswa mengkoordinasi&nbsp; teman-teman saat belajar kelompok atau mengerjakan tugas bersama.&nbsp;</p>', '<p>Gadget dapat menyimpan informasi penting, seperti catatan materi pelajaran, sehingga mudah dibawa dan dibaca di mana pun dan kapan pun, Kecanggihan gadget memudahkan siswa mencari informasi tentang materi pelajaran melalui internet.</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(614, '1', 'BinX_Wajib_IPS', 1, '', '', 15, '', '', '', '', '15BIN.JPG', '<p>sebaiknya seni wayang tidak perlu dikembangkan karena tidak sesuai dengan zaman modern, wayang itu kuno dan tradisional</p>', '<p>Untuk melestarikan seni tradisional, sebaiknya semua seni tradisional disatukan sehingga tidak diambil negara lain</p>', '<p>Seni tradisional perlu dilestarikan sebagai khasanah dan kekayaan kebudayaan yang dimiliki bangsa Indonesia&nbsp;</p>', '<p>Seni wayang merupakan seni tradisional yang tidak dapat mengikuti perkembangan zaman modern</p>', '<p>Generasi muda perlu mempelajari seni wayang karena selain upaya pelestarian juga belajar tentang kehidupan</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(612, '1', 'BinX_Wajib_IPS', 1, '', '', 13, '', '', '', '', '13BIN.JPG', '', '', '', '', '', '13A.JPG', '13B.JPG', '13C.JPG', '13D.JPG', '13E.JPG', '3', 1, 'A', 'Y', '', '');
