(610, '1', 'BinX_Wajib_IPS', 1, '', '', 11, '', '', '', '', '11BIN.JPG', '<p>Penggunaan media sosial dapat mendukung proses pembelajaran siswa di dalam kelas, dapat digunakan sebagai sumber belajar untuk mencari referensi</p>', '<p>Media sosial sebagai sarana komunikasi untuk meningkatkan keterampilan dan kemampuan siswa tanpa khawatir perbedaan jarak dan waktu</p>', '<p>Media sosial dapat membangun kepercayaan diri para pelajar yang mungkin tidak mereka miliki di dunia nyata, mereka bebas menyampaikan argumentasi.</p>', '<p>Penggunaan media sosial memiliki banyak dampak positif jika digunakan secara tepat, seperti menumbuhkan rasa percaya diri seseorang.</p>', '<p>Penggunaan media sosial berdampak positif jika diimbangi dengan pengawasan dari orang tua dan guru secara bersinergi.</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
