(689, '1', 'BinX_Wajib_BHS', 1, '', '', 14, '', '', '', '', '14BIN.JPG', '<p>Pemerintah mengembalikan pendidikan.&nbsp;</p>', '<p>Pendidikan dalam memajukan negara</p>', '<p>&nbsp;</p>\n<p>Pengembangan pendidikan di Indonesia</p>', '<p>&nbsp;</p>\n<p>Pentingnya pendidikan di Indonesia</p>', '<p>&nbsp;</p>\n<p>Peranan program Indonesia Mengajar</p>', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(690, '1', 'BinX_Wajib_BHS', 1, '', '', 15, '', '', '', '', '15BIN.JPG', '<p>sebaiknya seni wayang tidak perlu dikembangkan karena tidak sesuai dengan zaman modern, wayang itu kuno dan tradisional</p>', '<p>Untuk melestarikan seni tradisional, sebaiknya semua seni tradisional disatukan sehingga tidak diambil negara lain</p>', '<p>Seni tradisional perlu dilestarikan sebagai khasanah dan kekayaan kebudayaan yang dimiliki bangsa Indonesia&nbsp;</p>', '<p>Seni wayang merupakan seni tradisional yang tidak dapat mengikuti perkembangan zaman modern</p>', '<p>Generasi muda perlu mempelajari seni wayang karena selain upaya pelestarian juga belajar tentang kehidupan</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(691, '1', 'BinX_Wajib_BHS', 1, '', '', 16, '', '<p>Paragraf yang berisi sanggahan terhadap oposisi adalah &hellip;.</p>\n<p>&nbsp;</p>', '', '', '', '<p>Kehadiran situs jejaring sosial dalam beberapa tahun ini menjadi terapi bagi generasi muda. Mereka yang tidak berani tampil di luar, dapat&nbsp; mengekspresikan diri melalui media sosial. Mereka dapat berkenalan dengan seseorang , melalui layanan chatting.&nbsp;</p>', '<p>Kini gadget dapat menggantikan koran dan majalah. Melalui gadget, kita dapat melihat perkembangan berita terbaru. Kita dapat mengetahui berbagai informasi yang dibutuhkan melaui internet dalam gadget kita.&nbsp;</p>', '<p>Gadget berdampak buruk bagi perkembangan diri anak. Anak-anak tidak akan bisa bersosisalisasi dengan orang lain di sekitarnya, termasuk orang tua. Mereka sibuk dengan diri sendiri. Perintah dan nasihat orang tua tidak lagi mereka dengarkan.&nbsp;</p>', '<p>Sebagai alat komunikasi, gadget menjadi andalan siswa berinteraksi dengan teman-temannya. Alat ini mempermudah siswa mengkoordinasi&nbsp; teman-teman saat belajar kelompok atau mengerjakan tugas bersama.&nbsp;</p>', '<p>Gadget dapat menyimpan informasi penting, seperti catatan materi pelajaran, sehingga mudah dibawa dan dibaca di mana pun dan kapan pun, Kecanggihan gadget memudahkan siswa mencari informasi tentang materi pelajaran melalui internet.</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(692, '1', 'BinX_Wajib_BHS', 1, '', '', 19, '', '<p>Bacalah paragraf di bawah ini!</p>\n<p>(1)Saya fikir ponsellah yang membahayakan penggunanya. (2) Kita bisa melihat saat ini, ponsel tidak hanya digunakan oleh golongan orang dewasa tapi hampir semua umur menggunakan ponsel. (3) Bahkan anak-anak yang masih bersekolah TK sudah menggunakan ponsel. (4) Selain itu, melihat kecelakaan banyak terjadi di jalan raya yang disebabkan oleh ponsel.</p>\n<p><strong>Komentar yang TIDAK sesuai tentang penggunaan bahasa yang tepat dalam paragraf di atas adalah&hellip;</strong></p>', '', '', '', '<p>Paragraf tersebut menggunakan bahasa yang tidak baku dan kalimat yang tidak efektif</p>', '<p>Kata fikir&nbsp; seharusnya diganti piker, kata ponsel lebih tepat diganti dengan kata gawai</p>', '<p>Kalimat nomor 2 tidak efektif, menggunakan bahasa tidak baku, dan terlalu bertele-tele</p>', '<p>Kalimat nomor 3 tidak efektif, seharusnya anak-anak TK sudah menggunakan ponsel</p>', '<p>Kalimat nomor 4 merupakan kalimat yang memiliki penggunaan bahasa yang tepat</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(693, '1', 'BinX_Wajib_BHS', 1, '', '', 20, '', '<p>Bacalah paragraf di bawah ini!</p>\n<p>(1)Predikat kota Yogyakarta bukan hanya sekadar kota pelajar dan pariwisata, melainkan gudangnya industeri kecil, terutama kerajinan. (2) Ribuan industri kecil kerajinan berkembang di daerah ini, mulai dari skala kecil, misalnya suvenir hasil industri rumah tangga hingga skala besar yang bertaraf internasional. (3) Model-model yang dihasilkan juga sesuai dengan trend dunia.</p>\n<p><strong>Komentar yang sesuai dengan penggunaan bahasa dalam paragraf di atas adalah&hellip;.</strong></p>', '', '', '', '<p>Paragraf tersebut menggunakan bahasa baku</p>', '<p>&nbsp;</p>\n<p>Ada dua kata yang tidak menggunakan bahasa baku</p>', '<p>&nbsp;</p>\n<p>Kata predikat dan skala diganti dengan kata peredikat, sekala</p>', '<p>&nbsp;</p>\n<p>Kata industeri dan kata suvenir diganti dengan industri, souvenir</p>', '<p>&nbsp;</p>\n<p>Penulisan kata trend sudah tepat karena menggunakan bahasa baku</p>', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(694, '1', 'BinX_Wajib_BHS', 1, '', '', 18, '', '<p>Penyebab polusi suara seperti kereta api, mobil, pesawat, motor, dan helikopter yang memiliki suara yang keras dan berbahaya bagi kehidupan manusia. Polusi suara berbahaya bagi kehidupan manusia karena bisa menyebabkan gangguan pendengaran, kognitif, mental, dan kesehatan lainnya.</p>\n<p><strong>Paragraf di atas menggunakan pola pengembangan paragraf &hellip;.</strong></p>', '', '', '', '<p>Analogi</p>', '<p>Deduktif</p>', '<p>&nbsp;</p>\n<p>Sebab akibat</p>', '<p>&nbsp;</p>\n<p>Generalisasi</p>', '<p>&nbsp;</p>\n<p>Perbandingan</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(695, '1', 'BinX_Wajib_BHS', 1, '', '', 17, '', '<p>Paragraf di bawah ini yang menggunakan pengembangan analogi adalah&hellip;&hellip;</p>', '', '', '', '<p>Nasi goreng adalah makanan yang pada umumnya disukai oleh semua orang di seluruh dunia. Meskipun terlihat mudah dalam membuat, namun tidak terlihat. ternyata dalam membuat masakan yang satu ini tahapannya cukup rumit.&nbsp;</p>', '<p>Hujan yang terjadi pad amalam hari itu sangatlah deras, bahkan hujan tersebut terjadi sepanjang hari tanpa henti.air yang terus mengalir tersebut memenuhi selokan hingga selokan tidak mampu menampung air lagi. Terlebih lagi dengan keadaan sungai yang telah sempit dan dengkal membuat air meluap hingga ke perkampungan penduduk.oleh karena itu ,banjir datang dan menggenangi seluruh perkempungan penduduk.</p>', '<p>&nbsp;</p>\n<p>Tanpa kita sadar ada dua jenis teman yang ada disekitar kita. Kelompok yang pertama adalah teman dikalah senang. Teman-teman dikalah senang ini merupakan teman yang paling mudah dicari.mereka sangat banyak jumlahnya di luar sana .kelompok teman yang selanjutnya adalah teman dekat, teman dekat atau lebih dikenal dengan sahabat adalah teman yang benar-benar dekat dengan kita.</p>', '<p>&nbsp;</p>\n<p>Sifat manusia diibaratkan seperti padi yang terhapar luas dipersawahan. Padi yang bagus dan berisi akan semakin merunduk. Begitu pula dengan manusia ketika meraih kepandaian, kebesaran dan kekayaan, mereka akan menjadi semakin rendah hati dan dermawan. Apabila manusia itu sombong dan arogan mereka akan menjadi seperti padi kosong yang selalu berdiri tegak.</p>', '<p>&nbsp;</p>\n<p>Berdasarkan data keuangan tahun 2009, laba yang didapatkan oleh perusahaan PT X adalah sebesar 250 juta rupiah. Dimana pada tahun sebelumnya yaitu pada tahun 2008 perusahaan mampu menghasilkan laba sebesar 500 juta rupiah.Hal ini menunjukkan bahwa perusahaan mengalami penurunan dalam menghasilkan laba sebesar 250 juta rupiah atau turun sebesar 50% dari tahun sebelumnya.&nbsp;</p>', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(696, '1', 'BinX_Wajib_BHS', 1, '', '', 26, '', '<p>Bacalah kutipan teks biografi di bawah ini!</p>\n<p>Dokter Mohammad Hatta yang lebih dikenal dengan sebutan Bapak Koperasi Indonesia adalah seorang pemimpin yang berdisiplin tinggi, tegas, dan taat beragama. Pembawaannya sederhana walaupun ia keturunan berada dan apa yang dikatakannya selalu sesuai dengan perbuatannya. Bung Hatta lahir tanggal 12 Agustus 1902 di Bukittinggi. Pendidikan yang pernah ditempuhnya adalah ELS, MULO, Prins Hendrik School (Sekolah Dagang Belanda), dan Handels Hongerschool (Sekolah Tinggi Perdagangan) di Negeri Belanda hingga tamat. Pada tahun 1932, Bung Hatta memimpin partai Pendidikan Nasional Indonesia, karena kegiatan poliknya, Bung Hatta ditangkap dan pada tahun 1935 beliau di buang di Banda Neira dan terakhir di Sukabumi. Pada masa pendudukan Jepang tahun 1943 Bung Hatta memimpin kantor Pusat Tenaga Rakyat (Putera) bersama Bung Karno, Ki Hajar Dewantara, dan K.H. Mas Mansyur.</p>\n<p><strong>Keteladanan tokoh, Bapak Moh Hatta tersebut adalah . . . .</strong></p>', '', '', '', '<p>Berdisiplin tinggi, tegas, taat beragama, dan pembawaannya sederhana</p>', '<p>Bapak Koperasi Indonesia yang kehidupannya sangat sederhana</p>', '<p>Karena kegiatan politiknya, beliau rela dibuang ke Banda Neira</p>', '<p>Pendidikannya ditempuh di Negeri Belanda sejak SD hingga sekolah tinggi</p>', '<p>Memimpin kantor Pusat Tenaga Rakyat (Putera) bersama para pejuang bangsa</p>', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(697, '1', 'BinX_Wajib_BHS', 1, '', '', 25, '', '', '', '', '25.JPG', '<p>Struktur orientasi terdapat pada paragraf 1 yang berisi pengenalan latar belakang Jerome Polin</p>', '<p>Paragraf 2 juga termasuk kalimat 1 dan 2 termasuk struktur orientasi karena berisi pengenalan Jerome Poliin</p>', '<p>Struktur peristiwa dan masalah terdapat pada paragraf 2 yang berisi riwayat sekolah dan masalah yang dihadapi</p>', '<p>Paragraf 3 juga termasuk struktur peristiwa dan masalah yang dihadapi Jerome Polin untuk mendapatkan beasiswa</p>', '<p>Paragraf 4 termasuk bagian reorientasi karena berisi sudut pandang penulis terhadap Jerome Polin</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(698, '1', 'BinX_Wajib_BHS', 1, '', '', 23, '', '', '', '', '23.JPG', '', '', '', '', '', '23A.JPG', '23B.JPG', '23C.JPG', '23D.JPG', '23E.JPG', '1', 1, 'A', 'Y', '', ''),
(699, '1', 'BinX_Wajib_BHS', 1, '', '', 24, '', '', '', '', '24.JPG', '<p>Menggunakan alur maju, cerita diawali dengan pengenalan latar belakang jerome hingga kisah sukses yang didapatkannya</p>', '<p>Menggunakan sudut pandang orang ketiga serba tahu karena penyampaiannya disajikan secara rinci</p>', '<p>Menggunakan gaya penulisan naratif karena menceritakan urutan peristiwa secara kronologis</p>', '<p>Fokus penceritaan dalam biografi tersebut berfokus pada keberhasilan karier yang dicapai Jerome Polin</p>', '<p>Penulis tidak menggunakan percakapan atau dialog tokoh sehingga gaya penulisannya naratif</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(700, '1', 'BinX_Wajib_BHS', 1, '', '', 21, '', '', '', '', '21.JPG', '<p>Jermome Polin merupakan anak kedua dari tiga bersaudara dari pasangan dari bapak Marojahan Sijabat dan Chrissie Rahmeinsa</p>', '<p>Jerome kuliah di Universitas Waseda dengan jurusan matematika terapan dan aktif membuat konten edukatif di channel Youtube Nihongo Mantappu</p>', '<p>Jerome Polin mendapatkan beasiswa 100% dari Mitsui Bussan Scholarship dan berangkat ke Jepang pada pertengahan tahun 2016</p>', '<p>Selama satu tahun setengah, Jerome Polin bersekolah bahasa Jepang sebelum memulai pendidikannya di Universitas Waseda</p>', '<p>Selain di Universitas Waseda, Jerome Polin juga diterima kuliah di National University of Singapore dan Nanyang Technological University</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(701, '1', 'BinX_Wajib_BHS', 1, '', '', 22, '', '', '', '', '22.JPG', '<p>Jerome Polin dan keluarganya pindah ke Surabaya dan mendaftar sekolah internasional</p>', '<p>Orang tua Jerome Polin sempat mengalami kesulitan ekonomi untuk menyekolahkannya</p>', '<p>Jerome Polin diterima di dua universitas sekaligus di Singapura dan di Universitas Waseda Jepang</p>', '<p>Jerome Polin berusaha untuk mendapatkan beasiswa dengan mengumpulkan persyaratannya.</p>', '<p>Jerome bersedih karena tidak dapat berlibur ke luar negeri seperti teman-temannya di sekolah</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(702, '1', 'BinX_Wajib_BHS', 1, '', '', 27, '', '<p>Bacalah kutipan biografi di bawah ini!</p>\n<p>Parama Pradana Suteja, putra Solo kelahiran 25 tahun silam ini mendadak menjadi sorotan media. Tak sekadar kuliah di luar negeri, Parama juga sukses membuat takjub akan prestasinya yang luar biasa. Dirinya diterima oleh 11 universitas ternama di AS untuk program pascasarjananya, salah satunya Harvard University.</p>\n<p>Dalam wawancara eksklusifnya dengan Soloraya.id, Parama yang sebelumnya menyelesaikan studi S1-nya di UC (University of California) Berkeley, jurusan arsitektur ini menjelaskan bahwa dirinya tidak pernah membayangkan bisa mengambil studi di AS karena latar belakang pendidikannya berasal dari sekolah berbasis kurikulum nasional. Namun keputusannnya mendadak berubah saat dirinya bertemu dengan mantan kakak kelasnya saat duduk di bangku SMA di Solo yang bersekolah di AS dan bekerja di Apple Inc. Pertemuan itu membuat dirinya akhirnya memilih untuk studi di AS dan saat studi S1-nya, Parama mencoba peruntungan untuk melanjutkan studi program pasca sarjana dan mengejutkannya, Parama diterima di 11 universitas ternama di AS dengan 7 penawaran beasiswa.</p>\n<p><strong>Keistimewaan tokoh Parama Pradana Suteja adalah&hellip;..</strong></p>', '', '', '', '<p>Menjadi sorotan media karena prestasi di bidang pendidikan yang dicapainya</p>', '<p>Diterima di 11 Universitas ternama di AS untuk program Pascasarjana</p>', '<p>Menyelesaikan studi S1-nya di UC (University of California) Berkeley</p>', '<p>Bersekolah di AS dan bekerja di perusahaan terkenal yaitu Apple Inc</p>\n<p>&nbsp;</p>', '<p>Melanjutkan studi sarjana dan pascasarjana di negara Amerika Serikat</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(703, '1', 'BinX_Wajib_BHS', 1, '', '', 28, '', '', '', '', '28.JPG', '<p>Menggunakan kata kerja mental seperti termasuk, memulai,</p>', '<p>Menggunakan pronomina seperti kata ganti beliau dan ia</p>', '<p>Menggunakan kata tindakan seperti merupakan dan wartawan</p>', '<p>Menggunakan kata kerja pasif seperti di sana dan di berbagai</p>\n<p>&nbsp;</p>', '<p>Menggunakan kata adjektiva seperti ningrat&nbsp; dan nafas</p>', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(704, '1', 'BinX_Wajib_BHS', 1, '', '', 29, '', '', '', '', '29.JPG', '<p>Ayunda Faza Maudya, B.A., M.A., M.B.A. lahir di Jakarta, 19 Desember 1994 dari orang tua bernama Didit Jasmedi R. Irawan dan Muren Murdjoko. Maudy Ayunda dikenal sebagai Aktris dan penyanyi berbakat. Berbagai prestasi telah diraihnya. Pada tahun 2006 Dia juga mendapatkan penghargaan Aktris Utama Terpilih oleh Festival Film Jakarta&nbsp; tahun, Di tahun 2015, Dia dinobatkan menjadi pembicara muda di Forum Ekonomi Global. Selanjutnya, pada tahun 2016, dia dipilih menjadi Wanita Inspiratif Indonesia oleh Kementerian Pemberdayaan Perempuan dan Perlindungan Anak Republik Indonesia Tahun. Dia juga memenangkan BUBU Awards sebagai &ldquo;Influencer Digital Terbaik&rdquo; dan &ldquo;Milenial paling Berpengaruh&rdquo; oleh Style Awards. Selain itu, dia juga Terpilih dalam Forbes Indonesia &ldquo;30 Under &ldquo; di kategori Art, Syle, and Entertainment pada tahun 2020. Prestasinya sangat banyak sekali. Patut dijadikan contoh.</p>\n<p>&nbsp;</p>', '<p>Maudy Ayunda lahir di Jakarta, 19 Desember 1994 dari orang tua bernama Didit Jasmedi R. Irawan dan Muren Murdjoko. Berbagai prestasi telah diraihnya. Prestasinya sangat banyak dan mengisnpirasi. Pada tahun 2006 Dia juga mendapatkan penghargaan Aktris Utama Terpilih oleh Festival Film Jakarta&nbsp; tahun, Di tahun 2015, Dia dinobatkan menjadi pembicara muda di Forum Ekonomi Global. Selanjutnya, pada tahun 2016, dia dipilih menjadi Wanita Inspiratif Indonesia oleh Kementerian Pemberdayaan Perempuan dan Perlindungan Anak Republik Indonesia Tahun. Dia juga memenangkan BUBU Awards sebagai &ldquo;Influencer Digital Terbaik&rdquo; dan &ldquo;Milenial paling Berpengaruh&rdquo; oleh Style Awards. Selain itu, dia juga Terpilih dalam Forbes Indonesia &ldquo;30 Under &ldquo; di kategori Art, Syle, and Entertainment pada tahun 2020.</p>', '<p>&nbsp;</p>\n<p>Ayunda Faza Maudya, B.A., M.A., M.B.A. atau yang dikenal dengan nama Maudy Ayunda lahir di Jakarta, 19 Desember 1994 dari orang tua bernama Didit Jasmedi R. Irawan dan Muren Murdjoko. Maudy Ayunda dikenal sebagai Aktris dan penyanyi berbakat. Berbagai prestasi telah diraihnya. Pada tahun 2006 Dia juga mendapatkan penghargaan Aktris Utama Terpilih oleh Festival Film Jakarta&nbsp; tahun, Di tahun 2015, Dia dinobatkan menjadi pembicara muda di Forum Ekonomi Global. Selanjutnya, pada tahun 2016, dia dipilih menjadi Wanita Inspiratif Indonesia oleh Kementerian Pemberdayaan Perempuan dan Perlindungan Anak Republik Indonesia Tahun. Dia juga memenangkan BUBU Awards sebagai &ldquo;Influencer Digital Terbaik&rdquo; dan &ldquo;Milenial paling Berpengaruh&rdquo; oleh Style Awards. Selain itu, dia juga Terpilih dalam Forbes Indonesia &ldquo;30 Under &ldquo; di kategori Art, Syle, and Entertainment pada tahun 2020.</p>\n<p>&nbsp;</p>', '<p>Ayunda Faza Maudya, B.A., M.A., M.B.A. atau yang dikenal dengan nama Maudy Ayunda lahir di Jakarta, 19 Desember 1994. Maudy Ayunda dikenal sebagai Aktris dan penyanyi berbakat. Berbagai prestasi telah diraihnya. Pada tahun 2006 Dia juga mendapatkan penghargaan Aktris Utama Terpilih oleh Festival Film Jakarta&nbsp; tahun, Di tahun 2015, Dia dinobatkan menjadi pembicara muda di Forum Ekonomi Global. Selanjutnya, pada tahun 2016, dia dipilih menjadi Wanita Inspiratif Indonesia oleh Kementerian Pemberdayaan Perempuan dan Perlindungan Anak Republik Indonesia Tahun. Dia juga memenangkan BUBU Awards sebagai &ldquo;Influencer Digital Terbaik&rdquo; dan &ldquo;Milenial paling Berpengaruh&rdquo; oleh Style Awards. Selain itu, dia juga Terpilih dalam Forbes Indonesia &ldquo;30 Under &ldquo; di kategori Art, Syle, and Entertainment pada tahun 2020.</p>\n<p>&nbsp;</p>', '<p>Maudy Ayunda dikenal sebagai aktris dan penyanyi. Dia lahir di Jakarta, 19 Desember 1994 Berbagai prestasi telah diraihnya. Pada tahun 2006 Dia juga mendapatkan penghargaan Aktris Utama Terpilih oleh Festival Film Jakarta&nbsp; tahun, Di tahun 2015, Dia dinobatkan menjadi pembicara muda di Forum Ekonomi Global. Selanjutnya, pada tahun 2016, dia dipilih menjadi Wanita Inspiratif Indonesia oleh Kementerian Pemberdayaan Perempuan dan Perlindungan Anak Republik Indonesia Tahun. Dia juga memenangkan BUBU Awards sebagai &ldquo;Influencer Digital Terbaik&rdquo; dan &ldquo;Milenial paling Berpengaruh&rdquo; oleh Style Awards. Selain itu, dia juga Terpilih dalam Forbes Indonesia &ldquo;30 Under &ldquo; di kategori Art, Syle, and Entertainment pada tahun 2020. Dia terkenal dengan menyanyikan soundtrack Perahu Kertas.</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(705, '1', 'BinX_Wajib_BHS', 1, '', '', 30, '', '', '', '', '30.JPG', '<p>Jenderal Sudirman lahir pada 24 Januari 1916 di Bodas Karangjati, Purbalingga, Jawa Tengah. Sejak umur 8 bulan Sudirman diangkat menjadi anak oleh Toeridowati dan Raden Tjokrosoenaryo seorang asisten wedana rembang yang masih merupakan saudara dari Siyem. Beliau dibesarkan dalam keluarga yang sederhana. Semenjak kecil, Sudirman merupakan anak yang pandai dan juga sangat menyukai organisasi. Sudirman memulai pendidikan formal dari sekolah Taman Siswa, kemudian melanjutkan ke HIK(sekolah guru) Muhammadiyah, Surakarta, tetapi tidak sampai tamat hanya 1 tahun saja. Pada saat sekolah, Sudirman juga giat di organisasi Pramuka Hizbul Wathan. Sudirman juga pernah mengikuti pendidikan tentara PETA(Pembela Tanah Air) di Bogor. Kemudian beliau menjadi guru di sekolah HIS Muhamadiyah Cilacap. Karier beliau cemerlang dalam dunia pendidikan. Beliau menjadi kepala sekolah. Selain di didunia pendidikan, beliau juga aktif menjadi anggota Badan Pengurus Makanan dan anggota DPR karesidenan Banyumas.&nbsp;</p>', '<p>&nbsp;</p>\n<p>Jenderal Sudirman merupakan salah satu penjuang kemerdekaan Indonesia. Beliau memimpin perang melawan penjajah Indonesia. Republik Indonesia yang pertama dan termuda. Beberapa perang melawan penjajah telah beliau pimpin seperti perang melawan tentara Inggris di Ambarawa, memimpin pasukannya untuk membela Yogyakarta dari serangan Belanda II. Meski menderita sakit tuberkolosis paru-paru yang parah, ia tetap bergerilya dalam pembelaan kemerdekaan Republik Indonesia. Setelah Belanda menyerahkan kepulauan nusantara sebagai Republik Indonesia Serikat dalam konferensi meja bundar tahun 1949 di Den Haag. Jenderal Sudirman kembali ke Jakarta Bersama Presiden Sukarno dan Wakil Presiden Muhammad Hatta. Pada tanggal 29 Januari 1950, Jenderal Sudirman meninggal dunia di Magelang karena penyakit TBC parah yang dideritanya. Ia dimakamkan di Taman Makam Pahlawan Kusuma di Semaki, Yogyakarta.</p>', '<p>&nbsp;</p>\n<p>Jenderal Sudirman lahir pada 24 Januari 1916 di Bodas Karangjati, Purbalingga, Jawa Tengah. Sejak umur 8 bulan Sudirman diangkat menjadi anak oleh Toeridowati dan Raden Tjokrosoenaryo seorang asisten wedana rembang yang masih merupakan saudara dari Siyem. Beliau meninggal&nbsp; pada tanggal 29 Januari 1950, Jenderal Sudirman meninggal dunia di Magelang karena penyakit TBC parah yang dideritanya yang dideritanya. Ia dimakamkan di Taman Makam Pahlawan Kusuma Negara di Semaki, Yogyakarta. Sudirman dikenal oleh orang-orang disekitarnya dengan pribadinya yang teguh pada prinsip dan keyakinan, dimana ia selalu mengedepankan kepentingan masyarakat banyak dan bangsa di atas kepentingan pribadinya, bahkan kesehatannya sendiri. Ia dinobatkan sebagai Pahlawan Pembela Kemerdekaan pada tahun 1997, ia mendapatkan gelar sebagai Jenderal besar Anumerta dengan bintang lima, pangkat yang hanya dimiliki oleh beberapa Jenderal Republik Indonesia sampai sekarang.</p>', '<p>&nbsp;</p>\n<p>Jenderal Sudirman lahir pada 24 Januari 1916 di Bodas Karangjati, Purbalingga, Jawa Tengah. Beliau dilahirkan dari pasangan orang tua yang bernama Kartowirodji dan Siyem. Ayahnya adalah seorang pekerja di Pabrik Gula Kalibagor, Banyumas dan ibunya adalah keturunan wedana rembang. Sejak umur 8 bulan Sudirman diangkat menjadi anak oleh Toeridowati dan Raden Tjokrosoenaryo seorang asisten wedana rembang yang masih merupakan saudara dari Siyem. Beliau dibesarkan dalam keluarga yang sederhana. Semenjak kecil, Sudirman merupakan anak yang pandai dan juga sangat menyukai organisasi. Sudirman memulai pendidikan formal dari sekolah Taman Siswa, kemudian melanjutkan ke HIK(sekolah guru) Muhammadiyah, Surakarta, tetapi tidak sampai tamat hanya 1 tahun saja. Pada saat sekolah, Sudirman juga giat di organisasi Pramuka Hizbul Wathan. Sudirman juga pernah mengikuti pendidikan tentara PETA(Pembela Tanah Air) di Bogor. Kemudian beliau menjadi guru.</p>', '<p>&nbsp;</p>\n<p>Jenderal Sudirman merupakan salah satu penjuang kemerdekaan Indonesia. Beliau memimpin perang melawan penjajah Indonesia. Republik Indonesia yang pertama dan termuda. Beberapa perang melawan penjajah telah beliau pimpin seperti perang melawan tentara Inggris di Ambarawa, memimpin pasukannya untuk membela Yogyakarta dari serangan Belanda II. Beliau lahir pada 24 Januari 1916 di Bodas Karangjati, Purbalingga, Jawa Tengah. Beliau dilahirkan dari pasangan orang tua yang bernama Kartowirodji dan Siyem. Ayahnya adalah seorang pekerja di Pabrik Gula Kalibagor, Banyumas dan ibunya adalah keturunan wedana rembang. Sejak umur 8 bulan Sudirman diangkat menjadi anak oleh Toeridowati dan Raden Tjokrosoenaryo seorang asisten wedana rembang yang masih merupakan saudara dari Siyem. Beliau dibesarkan dalam keluarga yang sederhana.</p>', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
