(709, '1', 'BinX_Wajib_BHS', 1, '', '', 34, '', '', '', '', '34.JPG', '<p>Ada sesuatu yang rasanya mulai lepas dari tangandan meluncur lewat sela-sela jari kitaBanjir air mata</p>', '<p>Kita saksikan udara abu-abu warnanyaKita saksikan air danau yang semakin surut jadinyaGunung membawa abu</p>', '<p>Kita saksikan zat asam didesak asam arangdan karbon dioksida itu menggilas paru-paruBanjir air mata</p>', '<p>Kita saksikan zat asam didesak asam arangdan karbon dioksida itu menggilas paru-paru Longsor membawa air</p>\n<p>&nbsp;</p>', '<p>Kita saksikan udara abu-abu warnanyaKita saksikan air danau yang semakin surut jadinyaBanjir air mata</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(710, '1', 'BinX_Wajib_BHS', 1, '', '', 33, '', '', '', '', '32.JPG', '<p>Ada sesuatu yang rasanya mulai lepas dari tangan</p>', '<p>Kita saksikan air danau yang semakin surut jadinya</p>', '<p>&nbsp;</p>\n<p>Kita saksikan udara abu-abu warnanya</p>', '<p>&nbsp;</p>\n<p>Burung-burung kecil tak lagi berkicau di pagi hari</p>', '<p>&nbsp;</p>\n<p>Kita telah saksikan seribu tanda-tanda</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(711, '1', 'BinX_Wajib_BHS', 1, '', '', 38, '', '<p>Bacalah puisi berikut dengan saksama!</p>\n<p>Di mana pembangunan ini</p>\n<p>Tuan hidup kembali</p>\n<p>Dan bara kagum menjadi api</p>\n<p>Di depan sekali tuan menanti</p>\n<p>Tak gentar lawan banyaknya seratus kali</p>\n<p>Pedang di kanan, keris di kiri</p>\n<p>Berselubung semangat yang tak bisa mati</p>\n<p>&hellip;&hellip;&hellip;</p>\n<p>(Diponegoro: Chairil anwar)</p>\n<p><strong>Makna yang terkandung dalam kutipan puisi tersebut adalah&hellip;.</strong></p>', '', '', '', '<p>Sekarang ini Indonesia harus membangun semangat juang para pahlawan.</p>', '<p>Jangan gentar menghadapi masalah pembangunan apa saja.</p>', '<p>Semangat juang para pahlawan harus diteladani dalam membangun negeri.</p>', '<p>Pedang dan keris adalah senjata yang ampuh digunakan untuk berjuang.</p>', '<p>Pahlawan itu tidak boleh menyerah dan tidak boleh merasa gentar</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(712, '1', 'BinX_Wajib_BHS', 1, '', '', 35, '', '', '', '', '35.JPG', '<p>Manusia harus dapat menjaga kelestarian alam sehingga tidak menimbulkan bencana alam</p>', '<p>Manusia tidak boleh hanya menyaksikan bencana alam saja tetapi harus dijadikan pelajaran</p>', '<p>Manusia harus peka terhadap perubahan alam yang semakin lama semakin memprihatinkan</p>', '<p>Manusia harus bertaubat karena telah merusak alam dengan perbuatannya yang tidak terpuji</p>', '<p>Manusia harus memohon ampun karena telah merusak alam dengan perbuatannya yang tidak baik</p>', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(713, '1', 'BinX_Wajib_BHS', 1, '', '', 37, '', '<p>Bacalah dengan cermat puisi di bawah ini!</p>\n<p>Aku lalai di hari pagi</p>\n<p>Beta lengah di masa muda</p>\n<p>Kini hidup meracun hati</p>\n<p>Miskin ilmu miskin harta</p>\n<p>(Menyesal, A. Hasyim)</p>\n<p><strong>Kata meracun hati pada puisi di atas melambangkan&hellip;.</strong></p>', '', '', '', '<p>kekesalan</p>', '<p>kekhwatiran</p>', '<p>kelalaian</p>', '<p>keteledoran</p>', '<p>kesususahan</p>', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
